import "./BookInstance.css";
function Book(props) {
  return (
    <>
      <div className="container-fluid">
        <div className="row">
          <div className="col-2 bookCol">
            <h1 className="display-2">{props.name}</h1>
            <p>{props.desc}</p>
          </div>
        </div>
      </div>
    </>
  );
}

export default Book;
